  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Oregon Islands, Three Arch Rocks, and Cape Meares
  NWRs for the next 15 years. This plan outlines the refuges' vision and purpose and
  describes how Oregon Islands, Three Arch Rocks, and Cape Meares NWRs will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the refuges, information about the physical and biological environment, information
  about the management direction, and public uses. Key planning issues include: wildlife
  disturbance, law enforcement, public access, monitoring, climate change, invasive
  species, and cooperative efforts.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
